import { useState, useEffect} from 'react';
import axios from 'axios';
function Dashboard() {
    const[ordini, setOrdini] = useState([])
    useEffect(() => {
        axios.get('http://127.0.0.1:8000/ordinazioni/',[])
        .then(res => {
            console.log(res)
            setOrdini(res.data)
        },)
        .catch(err =>{
            console.log(err)
        })
    },[])
const data = {
  
  products: [
      ordini
     ]    ,
};
}
export default data;
